import React from "react";
import Header from '../components/Header';
import Footer from '../components/Footer';
import Img1 from '../img/about_me_scroll_img1.jpg';



function AboutMe() {
  return (
    <div>
      <Header />

      <div className="img-holder about-me-heading" style={{backgroundImage: "url(" + Img1 + ")"}}>
        <div className="about-me-heading">
          <p>
            <p style={{lineHeight: "0.4em"}}>Hallo, </p>
            <p style={{lineHeight: "0.1em", paddingLeft: "1em"}}>Ich bin Anita </p>
          </p>
        </div>
      </div>
      <div className="img-holder" style={{backgroundColor: "white"}} />

      <Footer />
      <br />
    </div>

  );
}

export default AboutMe;
